CREATE TABLE company (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    description TEXT NOT NULL,
    slogan VARCHAR(255),
    address VARCHAR(255),
    email VARCHAR(255),
    nif VARCHAR(255),
    stat VARCHAR(255),
    rcs VARCHAR(255),
    logo TEXT
);

